import React from "react";
import Skeleton from "../SkeletonStyles/Skeleton";
import SkeletonAnimation from "../SkeletonStyles/SkeletonAnimation";
import { SkeletonThemeProps } from "../../../../types/globalTypes";

const SkeletonLoad: React.FC<SkeletonThemeProps> = ({ theme }) => {
  const themeClass = theme || "light";

  return (
    <div className={`skeletonWrapper ${themeClass}`}>
      <div className="skeletonData">
        <Skeleton type="text" />
      </div>
      <div>
        <Skeleton type="title" />
        <Skeleton type="title" />
        <Skeleton type="title" />
      </div>
      {/* <SkeletonAnimation /> */}
    </div>
  );
};

export default SkeletonLoad;
